import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Image from "react-bootstrap/Image";
import logo from "./logo.svg";
import "./App.css";

function App() {
  //const title = "aaa";
  //const description = "bbbbbbbb";
  const titles = ["Spring", "Summer", "Autumn", "Winter"];
  let seasonsList = [];
  titles.forEach((season, index) => {
    seasonsList.push(<li>{season}</li>);
  });

  return (
    <Container fluid>
      <div>
        <h2>Seasons of the year</h2>
        <ul>{seasonsList}</ul>
      </div>

      <Container className="text-center">
        <Row>
          <Col md={{ span: 6, offset: 3 }}>
            <h1 className="p-5">
              <Image
                src={logo}
                alt="osaka design office"
                className="img-fluid"
              ></Image>
            </h1>
          </Col>
        </Row>
      </Container>
      <Container className="text-left">
        <h2 className="text-center mb-5">Works</h2>
        <Row>
          <Col sm={12} md={4} lg={4} xl={4} xxl={3} className="border">
